package main

import (
	"bytes"
	"encoding/base64"
	"image/jpeg"
	"testing"
)

func TestPrimaryColors(t *testing.T) {
	base64jpeg := ``
	s, err := base64.StdEncoding.DecodeString(base64jpeg)
	if err != nil {
		t.Fatal(err)
	}

	i, err := jpeg.Decode(bytes.NewReader(s))
	c1, c2, c3 := getThreeMostPrevalentColorsInImage(i)

	if *c1 != 0xffffff || *c2 != 0xfcd309 || *c3 != 0x4bb547 {
		t.Errorf("wrong prevalent colors returned, expected: [%06x, %06x, %06x], got [%06x, %06x, %06x]", 0xffffff, 0xfcd309, 0x4bb547, *c1, *c2, *c3)
	}
}
